CREATE OR REPLACE FUNCTION unit_tests_unit_testing.tests_details(
    IN _build_dependencies boolean DEFAULT false,
    OUT _results unit_testing.unit_test_result[])
  RETURNS unit_testing.unit_test_result[] AS
$BODY$
<<me>>
DECLARE
  context               	  text;
  full_function_name 	          text;
  test_name		          text = '';
  error			          diagnostic.error;
BEGIN
  GET DIAGNOSTICS context = PG_CONTEXT;
  full_function_name = diagnostic.full_function_name(context);
  -- check to build dependencies
  IF _build_dependencies THEN
      PERFORM unit_testing.build_function_dependencies(diagnostic.function_name(context));
    RETURN;
  END IF;
  --------------------------------------
  test_name = 'INSERT tests_details';
  --------------------------------------
  BEGIN
istruzione SQL ""INSERT INTO public.valutations(valutation,subject,grade_type,topic,grade,evaluation,private,teacher,on_date,note,classroom_student) VALUES (''86813000000000'',''29107000000000'',''72745000000000'',''62012000000000'',''29096000000000'',NULL,''f'',''29148000000000'',''2013-12-06'',NULL,''31458000000000'')""
funzione PL/pgSQL unit_tests.valutations(boolean) riga 30 a istruzione SQL
istruzione SQL ""SELECT unit_tests.valutations();""
funzione PL/pgSQL unit_testing.run(text,boolean,boolean,boolean,bigint,oid,text) riga 209 a EXECUTE","Nella valutazione che si sta inserendo, l''anno di corso e l''indirizzo scolastico dell'' argomento: ''62012000000000'' non sono gli stessi della classe: ''29024000000000''.","Controllare l''anno di corso e l''indirizzo scolastico dell''argomento indicato oppure la materia e ritentare l''operazione.","")');


    _results =  _results || assert.pass(full_function_name, test_name);

    EXCEPTION
      WHEN OTHERS THEN
        GET STACKED DIAGNOSTICS error.returned_sqlstate = RETURNED_SQLSTATE, error.message_text = MESSAGE_TEXT, error.schema_name = SCHEMA_NAME, error.table_name = TABLE_NAME, error.column_name = COLUMN_NAME, error.constraint_name = CONSTRAINT_NAME, error.pg_exception_context = PG_EXCEPTION_CONTEXT, error.pg_exception_detail = PG_EXCEPTION_DETAIL, error.pg_exception_hint = PG_EXCEPTION_HINT, error.pg_datatype_name = PG_DATATYPE_NAME;
        _results = _results || assert.fail(full_function_name, test_name, 'INSERT unit_tests_unit_testing.tests_details FAILED'::text, error);
        RETURN;
  END;
  RETURN;
END
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
ALTER FUNCTION unit_tests_unit_testing.tests_details(boolean)
  OWNER TO postgres;
